import * as React from 'react';
import { Paper, Card, CardContent } from '@mui/material';
import "./welcome.css"

export default function Welcome() {
  return (
    
    <div className='root'>
      <Paper className='paper'>
        <Card className='card'>
          <CardContent>Hello World</CardContent>
        </Card>
      </Paper>
    </div>
    
  );
}
